import React ,{Component} from "react";
import Button from '@material-ui/core/Button';
class homeComponent extends Component<any, any> {

    render() {
        return (
            <div>

                <Button variant="contained" color="primary">
                    Hello World
                </Button>
            </div>

        )

    }

}

export default homeComponent
